/* hide the blue unread tab icon, just finished loading 
https://github.com/mbnuqw/sidebery/issues/712 */
.Tab[data-updated="true"] .fav .badge {
  display: none;
}
.Tab[data-updated="true"] .fav img,
.Tab[data-updated="true"] .fav svg {
  mask: none;
}
